export default function Navbar() {
  return (
    <div className="flex justify-between items-center py-4 px-8 shadow-md">
      <h3 className="text-2xl font-bold text-gray-800">FoundProtocol</h3>
      <button className="rounded-full bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4">
        Contact Us
      </button>
    </div>
  );
}
